INSERT INTO `board` VALUES ('NOTICE',1,'2023-08-01 00:00:00.000000','2023-08-16 16:58:19.266856','8월 1일 제 1회 랜덤플레이댄스 온라인 대회가 개최됩니다! 많은 관심과 참여 부탁드립니다.','url1','(2023-08-1) 제 1회 랜덤플레이댄스 온라인 대회 안내',1,3),('NOTICE',2,'2023-08-01 00:00:00.000000','2023-08-01 00:00:00.000000','연습실 기능이 추가되었습니다. 이제 연습실에서 캠을 키고 댄스 연습을 할 수 있어요. 열심히 연습해서 멋진 댄서가 되어보세요!','url2','연습실 기능 추가 안내',1,0),('NOTICE',3,'2023-08-01 00:00:00.000000','2023-08-01 00:00:00.000000','오프라인 랜덤 댄스 파티가 오늘 개최됩니다. 다양한 음악과 함께 신나는 시간을 보내고 싶다면 지금 바로 참가 신청해주세요!','url3','오프라인 랜덤 댄스 파티 개최 안내',1,0),('NOTICE',4,'2023-08-01 00:00:00.000000','2023-08-16 23:40:45.428983','이제부터 원하는 댄스 연습 노래를 신청할 수 있는 기능이 추가되었습니다. 연습실에서 연습하고 여러분의 멋진 댄스 실력을 자랑해보세요.','','댄스 연습 노래 신청 추가',1,2),('NOTICE',5,'2023-08-01 00:00:00.000000','2023-08-16 17:35:21.083040','8월 20일 제 2회 랜덤플레이댄스 온라인 대회가 개최됩니다. 다양한 춤 스타일로 경쟁하고 포인트를 받아보세요!','url5','(2023-08-20) 제 2회 랜덤 댄스 대회 참가 신청 안내',1,4),('TALK',6,'2023-08-02 00:00:00.000000','2023-08-17 00:55:41.361890','요즘 성수 카페 새로 생긴데 많던데 같이 갈사람 댓글 남겨주세요 ~~','url6','내일 성수 카페 갈 사람 모여주세요!',6,4),('TALK',7,'2023-08-02 00:00:00.000000','2023-08-14 02:02:26.515997','오늘 저녁에 같이 먹을 사람을 구해요. 같이 식사하며 이야기 나누고 싶어요!','','오늘 저녁 같이 먹을 사람 구해요',3,0),('TALK',8,'2023-08-02 00:00:00.000000','2023-08-02 00:00:00.000000','여행 같이 떠날 친구 구합니당. 원하시는 여행지 있으면 같이 정해봐요!','url8','여행 같이 갈 사람 ??!',5,0),('TALK',9,'2023-08-02 00:00:00.000000','2023-08-02 00:00:00.000000','영화 보러 갈 사람을 찾아요~ 같이 영화 관람하면서 즐거운 시간 보내요. 분당쪽 입니다 ','url9','영화 보러 같이 가실 분(서현 !!)',4,0),('TALK',10,'2023-08-02 00:00:00.000000','2023-08-11 23:58:30.266323','강남에서 같이 운동 하실 분?? 서로 자세도 봐주고 건강하게 함께 운동합시다 :)','','강남 운동 같이 할 친구 구해요',8,0),('MEETING',11,'2023-08-03 00:00:00.000000','2023-08-14 21:01:05.201131','주말에 서울 강남역 근처 연습실을 같이 빌려서 댄스 연습하실 분을 찾습니다. 함께 실력을 향상시키고 즐겁게 춤춰요!','url11','주말 댄스 모임 참여자 모집',2,0),('MEETING',12,'2023-08-03 00:00:00.000000','2023-08-16 16:56:05.849512','강남역 근처 연습실을 예약하려고 하는데 혼자서는 비용이 부담스럽네요 ㅠㅠ 같이 연습실 빌려서 실력을 향상시킬 댄서를 모집합니다.','','서울 강남역 연습실 같이 빌리실 분 구해요',3,1),('MEETING',13,'2023-08-03 00:00:00.000000','2023-08-03 00:00:00.000000','춤 좋아하는 분들과 함께 정기적으로 모여서 연습하고 발전하는 모임을 만들려고 합니다. 관심 있으신 분들은 연락주세요! (오픈채팅)','url13','같이 댄스 연습할 친구 모집합니다',7,0),('MEETING',14,'2023-08-03 00:00:00.000000','2023-08-17 00:54:30.529208','오프라인 댄스 파티에 참가하실 분을 모집합니다. 음악과 함께 즐거운 시간 보내고 멋진 댄서들과 인연을 만들어요! ㅋㅋㅋ','url14','오프라인 댄스 파티 참가자 모집',5,2),('MEETING',15,'2023-08-03 00:00:00.000000','2023-08-17 00:59:44.069370','댄스 실력에 상관없이 즐겁게 춤출 수 있는 모임을 만들어요. 댄스를 좋아하고 함께 즐길 친구들을 찾습니다!','','댄스 실력 상관없이 함께 춤출 분 찾아요!',6,4),('MEETING',16,'2023-08-11 07:03:11.051876','2023-08-16 09:24:29.465810','새 글 추가3',NULL,'새 글 추가',2,0),('TALK',17,'2023-08-11 07:04:11.253473','2023-08-14 20:19:55.389665','글 추가1','','글 추가1',2,0),('TALK',18,'2023-08-11 07:04:21.361937','2023-08-16 09:26:32.679404','글 추가2','','글 추가2',2,0),('TALK',19,'2023-08-11 07:04:30.348758','2023-08-11 07:04:30.348758','글 추가3','','글 추가3',2,0),('TALK',20,'2023-08-11 07:04:40.259231','2023-08-11 07:04:40.259231','글 추가4','','글 추가4',2,0),('TALK',21,'2023-08-11 07:04:49.809217','2023-08-11 07:04:49.809217','글 추가5','','글 추가5',2,0),('TALK',22,'2023-08-11 07:05:00.118154','2023-08-11 07:05:00.118154','글 추가6','','글 추가6',2,0),('MEETING',23,'2023-08-14 05:47:17.275809','2023-08-14 05:47:17.275809','정모해서 춤 같이 춰보고 싶네요 \n화이팅',NULL,'오프라인 정모해요 ',12,0),('TALK',24,'2023-08-14 05:48:03.153454','2023-08-16 16:57:21.755348','안녕 안녕하세요','C:\\fakepath\\사진.jpg','안녕하세요 테스트로 글 올려봐요',12,3),('TALK',25,'2023-08-14 05:48:39.137721','2023-08-14 20:59:05.180143','안녕하세요 테스트입니다','','안녕하세요 ',12,0),('MEETING',26,'2023-08-15 14:42:56.976954','2023-08-16 16:55:55.644595','test111',NULL,'test1',8,1),('MEETING',27,'2023-08-15 14:42:57.630766','2023-08-15 14:42:57.630766','test111',NULL,'test1',8,0),('MEETING',28,'2023-08-15 14:45:18.264521','2023-08-15 14:45:18.264521','test22',NULL,'test2',8,0),('MEETING',29,'2023-08-15 14:45:44.213577','2023-08-15 14:45:44.213577','test3333',NULL,'test33',8,0),('TALK',30,'2023-08-15 14:52:48.255381','2023-08-16 16:56:13.846740','자유게시판 내용입니다111111