INSERT INTO `comment` VALUES (1,'2023-08-02 00:00:00.000000','2023-08-02 00:00:00.000000','저도 성수 카페에 관심 있어요! 같이 가면 좋을 것 같아요.',6,2),(2,'2023-08-02 00:00:00.000000','2023-08-02 00:00:00.000000','저도 서울 성동구에 사는데 성수 카페 같이가요 ! ㅋㅋㅋ',6,7),(3,'2023-08-02 00:00:00.000000','2023-08-02 00:00:00.000000','오늘은 시간이 안되서 아쉽네요ㅠㅠ 다음 기회에는 꼭 함께하고 싶어요!',6,8),(4,'2023-08-02 00:00:00.000000','2023-08-02 00:00:00.000000','오늘 저녁 시간이 맞으면 함께 먹고 싶은데 장소는 어디인가요?',7,2),(5,'2023-08-02 00:00:00.000000','2023-08-02 00:00:00.000000','몇 명 생각하고 계세요? 같이 가는 사람들과 같이 아이디어를 공유하면 좋을 것 같아요!',8,3),(6,'2023-08-02 00:00:00.000000','2023-08-02 00:00:00.000000','저도 여행 같이 갈 친구를 찾고 있는데 ! 혹시 어디 생각하세요 ??',8,4),(7,'2023-08-02 00:00:00.000000','2023-08-02 00:00:00.000000','영화 새로 나온거 보고싶었는데 저는 양재라 중간 위치도 괜찮으세요?',9,5),(8,'2023-08-02 00:00:00.000000','2023-08-02 00:00:00.000000','저도 강남에서 운동 다니고 있는데 같이 운동을 하면 좋을 거 같네요 ㅋㅋ',10,6),(9,'2023-08-02 00:00:00.000000','2023-08-02 00:00:00.000000','무게 몇 정도 치세요?',10,7),(10,'2023-08-02 00:00:00.000000','2023-08-02 00:00:00.000000','오 저도 비용이 부담스러웠는데 같이 연습하면 부담없고 더 재밌을거 같네용!',12,8),(11,'2023-08-02 00:00:00.000000','2023-08-02 00:00:00.000000','강남역 근처인데, 위치가 좋네요! 함께 참가하고 싶어요~',12,4),(12,'2023-08-02 00:00:00.000000','2023-08-02 00:00:00.000000','강남역 근처 연습실 좋네요. 저도 같이 할래요!!!!!',12,5),(14,'2023-08-02 00:00:00.000000','2023-08-02 00:00:00.000000','파티에 참가하고 싶어요. 어떻게 신청하면 되나요?',14,4),(15,'2023-08-02 00:00:00.000000','2023-08-02 00:00:00.000000','댄스 파티 너무 기대돼요 ㅎㅎㅎ',14,6),(16,'2023-08-02 00:00:00.000000','2023-08-02 00:00:00.000000','저도 참여하고 싶긴한데 조금 부족해도 괜찮나요?',15,7),(17,'2023-08-09 13:09:05.801599','2023-08-09 13:09:05.801599','ㅎㅎ',6,1),(21,'2023-08-11 23:58:20.973992','2023-08-11 23:58:20.973992','ㅋㅋㅋㅋ',10,6),(24,'2023-08-14 02:02:16.200155','2023-08-14 02:02:16.200155','ㅋㅋ',7,6),(35,'2023-08-14 20:52:12.317392','2023-08-14 20:52:12.317392','테스트 댓글 추가',17,2),(42,'2023-08-17 00:57:28.441085','2023-08-17 00:57:28.441085','하하하ㅏ하\n',15,6),(43,'2023-08-17 00:59:07.773641','2023-08-17 00:59:07.773641','ㄹㄹㄹㄹ',15,6);
