INSERT INTO `music_apply` VALUES (1,'2023-08-01 00:00:00.000000','2023-08-16 18:22:25.234071','NEWJEANS','이 곡은 가사와 멜로디가 너무 사랑스럽고 경쾌해서 연습실에 추가해주셨으면 좋겠습니다. 마음을 환기하고 기분 좋은 에너지를 얻을 수 있을 것 같아요. 제 춤 실력을 향상시키는 동기가 되는 이 노래와 함께 행복한 시간을 보내고 싶습니다.',3,'New Jeans',2),(2,'2023-08-01 00:00:00.000000','2023-08-16 18:21:56.932381','NEWJEANS','이 곡은 매력적인 멜로디와 따뜻한 가사로 가득 차 있어서 노래 연습실에서 함께 부르고 싶습니다. 이 곡을 연습하면서 내면의 감정을 표현하는 법을 더욱 향상시킬 수 있을 것 같아요.\'Super Shy\'를 추며 자신감을 더해보고 싶습니다.',5,'Super Shy',3),(3,'2023-08-01 00:00:00.000000','2023-08-16 17:28:12.953585','NEWJEANS','이 곡은 다이나믹한 사운드와 중독성 있는 리듬이 너무 좋아서 춤추고 싶습니다. \'ETA\'는 저를 더욱 다채롭게 표현할 수 있는 기회가 될 것 같아요. 연습실에서 이 곡을 연습하며 더 나은 춤 실력을 향상시키고 싶습니다.',3,'ETA',4),(4,'2023-08-01 00:00:00.000000','2023-08-16 18:29:48.834811','NEWJEANS','이 곡은 부드러운 분위기와 고요한 가사가 마음을 안정시켜줘서 연습실에 추가해주셨으면 좋겠습니다. 이 곡을 추며 감정을 더 깊게 전달하고, 보다 섬세한 표현력을 키워보고 싶습니다. 여러분과 함께 \'Cool With You\'를 추며 마음을 편안하게 녹일 수 있으면 좋겠어요.',1,'Cool With You',5),(5,'2023-08-01 00:00:00.000000','2023-08-16 18:29:38.850880','NEWJEANS','이 곡은 활기찬 리듬과 격렬한 에너지가 느껴져서 연습실에서 함께 열정을 표현하고 싶습니다. 이 곡을 추며 에너지 넘치는 시간을 공유하며 몸과 마음을 활기차게 만들어보고 싶어요. \'Get Up\'을 추면서 자유로운 분위기 속에서 춤 실력을 더욱 향상시키고 싶습니다.',2,'Get Up',6),(6,'2023-08-11 03:34:34.714201','2023-08-16 07:59:57.998903','장혜리','감성곡도 춤출 수 있습니다...',1,'내게 남은 사랑을 드릴게요',10),(7,'2023-08-14 05:45:14.203510','2023-08-16 20:36:40.503645','Michael Jackson','테스트용으로 신청합니다.',3,'billie jean',12),(8,'2023-08-16 23:39:25.752543','2023-08-16 23:39:25.752543','이날치','한국적인 춤이 가장 세계적인 것이죠.',0,'범내려온다',2);
