INSERT INTO `random_dance` VALUES (1,'2023-08-01 00:00:00.000000','2023-08-01 00:00:00.000000','모든 준비가 끝났어요! 랜덤 댄스 파티가 시작됩니다. 함께 즐기며 세상을 흔들어봐요. 마음을 열고 새로운 친구들과 함께 춤을 추며 특별한 순간을 만들어보세요.','RANKING','2023-08-31 18:00:00.000000',10,'2023-08-01 10:00:00.000000','url','세상을 흔들어라! 오늘은 우리의 랜덤 댄스 파티 날!',4),(2,'2023-08-01 00:00:00.000000','2023-08-01 00:00:00.000000','춤은 마법과 같은 힘을 갖고 있어요. 랜덤으로 선택된 리듬과 움직임으로 펼쳐지는 춤의 세계에 빠져보세요. 감각적인 음악과 함께 신나게 춤을 즐기며 일상을 잠시 잊어보는 건 어떨까요?','RANKING','2023-08-31 18:00:00.000000',10,'2023-08-01 10:00:00.000000','url','움직임의 마법! 랜덤으로 펼쳐지는 춤의 세계',4),(3,'2023-08-01 00:00:00.000000','2023-08-01 00:00:00.000000','오늘은 주사위처럼 몸을 굴려서 랜덤으로 선택된 춤을 추는 놀라운 경험을 해보세요! 어떤 스타일이 나올지 미리 예상할 수 없는 재미와 설렘으로 가득찬 하루를 보낼 준비가 되셨나요?','RANKING','2023-08-31 18:00:00.000000',10,'2023-08-01 10:00:00.000000','url','당신의 몸을 주사위처럼 굴려보세요! 랜덤 댄스의 모든 것',4),(4,'2023-08-01 00:00:00.000000','2023-08-01 00:00:00.000000','우주적인 에너지로 물들어진 랜덤 댄스 대회가 찾아왔어요! 빛나는 별 아래서 펼쳐지는 이 축제에 함께해보세요. 다양한 음악에 맞춰 춤을 추며 최고의 댄서가 되어보는 건 어떨까요?','RANKING','2023-08-31 18:00:00.000000',10,'2023-08-01 10:00:00.000000','url','힘을 내어 춤추라! 오늘은 우주적 랜덤 댄스 대회!',4),(5,'2023-08-01 00:00:00.000000','2023-08-01 00:00:00.000000','음악의 흐름에 맞춰 랜덤한 리듬으로 여행을 떠나보세요. 각기 다른 춤 스타일을 탐험하며 새로운 경험과 만남을 만들어보는 것은 어떨까요? 모험심을 자극하는 이 춤의 여정에 동참해보세요!','RANKING','2023-08-31 18:00:00.000000',10,'2023-08-01 10:00:00.000000','url','춤 속의 모험, 랜덤한 리듬에 맞춰 떠나는 여행',4),(6,'2023-08-01 00:00:00.000000','2023-08-01 00:00:00.000000','힘들고 지친 하루를 랜덤 댄스로 흔들어보세요. 음악에 몸을 맡기며 스트레스와 피로를 떨쳐내는 시간을 가져보는 건 어떨까요? 즐거운 음악과 함께 춤추며 새로운 활력을 얻어보세요.','BASIC','2023-08-31 18:00:00.000000',15,'2023-08-20 10:00:00.000000','url','하루의 스트레스를 흔들어놓을 때! 랜덤 댄스 터치',5),(7,'2023-08-01 00:00:00.000000','2023-08-01 00:00:00.000000','비트와 리듬이 느껴지는 음악에 몸을 맡겨보세요. 랜덤하게 선택된 곡들과 함께 춤추며 신나는 시간을 만끽해보세요. 음악의 마법에 빠져들어 설렘을 느껴보는 것은 어떨까요?','BASIC','2023-08-31 18:00:00.000000',15,'2023-08-20 10:00:00.000000','url','비트가 주는 설렘! 랜덤 음악에 신나게 몸을 맡겨요',5),(8,'2023-08-01 00:00:00.000000','2023-08-01 00:00:00.000000','랜덤으로 선택된 춤에 몸을 맡기면 예상치 못한 즐거움이 찾아올지도 모릅니다. 춤에 녹아드는 순간을 느끼며 랜덤 선택의 특별한 매력을 경험해보세요. 당신의 몸이 이야기하는 순간을 함께해보는 건 어떨까요?','BASIC','2023-08-31 18:00:00.000000',15,'2023-08-20 10:00:00.000000','url','춤에 녹아드는 순간, 랜덤 선택이 가져다주는 즐거움',5),(9,'2023-08-01 00:00:00.000000','2023-08-01 00:00:00.000000','랜덤 댄스 파티에 여러분을 초대합니다! 함께 모여 즐겁게 춤을 추며 특별한 시간을 만들어보세요. 새로운 친구들과의 만남과 함께하는 즐거움을 놓치지 마세요.','BASIC','2023-08-31 18:00:00.000000',15,'2023-08-20 10:00:00.000000','url','함께라면 더 즐거운! 랜덤 파티로 초대합니다',5),(10,'2023-08-01 00:00:00.000000','2023-08-01 00:00:00.000000','음악과 춤이 만들어내는 하모니를 느껴보세요. 서로 다른 춤 스타일을 통해 연결되는 랜덤 댄스의 매력을 느껴보며, 우리의 다양성과 개성이 어떻게 아름다운 하모니를 이루는지 함께 탐색해보세요.','BASIC','2023-08-31 18:00:00.000000',15,'2023-08-20 10:00:00.000000','url','춤의 연결고리, 우리의 하모니! 랜덤 댄스로 만나요',5),(11,'2023-08-11 07:41:11.080675','2023-08-11 07:41:11.080675','새로 만들기 방 내용','RANKING','2023-08-11 17:41:00.000000',4,'2023-08-11 16:41:00.000000','','새로 만들기 방 제목',1),(12,'2023-08-11 08:20:48.813246','2023-08-11 08:20:48.813246','새로운 방 내용입니다.','RANKING','2023-08-11 19:20:00.000000',3,'2023-08-11 17:20:00.000000','','새로운 방을 만듭시다',1),(13,'2023-08-11 11:12:24.388793','2023-08-11 11:12:24.388793','sdfds','RANKING','2023-08-11 21:13:00.000000',4,'2023-08-11 20:12:00.000000','','0811_TEST',4),(14,'2023-08-11 11:12:26.083502','2023-08-11 11:12:26.083502','sdfds','RANKING','2023-08-11 21:13:00.000000',4,'2023-08-11 20:12:00.000000','','0811_TEST',4),(15,'2023-08-11 11:28:57.872838','2023-08-11 11:28:57.872838','sdfdsds','RANKING','2023-08-11 21:29:00.000000',4,'2023-08-11 20:28:00.000000','','0811_TEST2',4),(16,'2023-08-11 11:34:57.719752','2023-08-11 11:34:57.719752','테스트!!!!','RANKING','2023-08-11 21:34:00.000000',4,'2023-08-11 20:34:00.000000','','0811_TEST3',4),(17,'2023-08-11 11:47:50.936760','2023-08-11 11:47:50.936760','방제목2222','RANKING','2023-08-11 22:47:00.000000',3,'2023-08-11 20:47:00.000000','','방제목2222',2),(18,'2023-08-11 12:17:07.061714','2023-08-11 12:17:07.061714','방내용12132123132','RANKING','2023-08-11 22:17:00.000000',3,'